import React, { useEffect, useState } from 'react';
import Card from '../Card/Card';
import './RankedData.css'; // Import the CSS file

const RankedData = () => {
    const [data, setData] = useState([]);

    useEffect(() => {
        fetch("http://localhost:8080/api/olx").then(res => res.json()).then(info => setData(info));
    }, [])

    return (
        <div className="card-container"> {/* Add card-container class */}
            {/* <Card/> */}
            {data.map(({ price, details, title, subtitle, img }, index) => {
                return (
                    <Card
                        price={price}
                        details={details}
                        title={title}
                        subtitle={subtitle}
                        img={img}
                        key={index}
                        className="card" // Add card class
                    />
                );
            })}
        </div>
    )
}

export default RankedData;
